//                  CONTACT PAGE AS A COMPONENT                   \\

// Importing Modules :
import React from 'react';

import {Name} from "./App"

const Contact = (props)=>{
    return(
        <>
            This is CONTACT-US Page {props.name}.
        </>
    )
}

// Exporting Contact COmponent :
export default Contact;
